// Filename - pages/about.js
 
import React from "react";

const learnLanguages = [
    "Norsk",
    "Francais",
    "Italiano"
];

const useLanguages = [
    "English"
];

function DropDown(props) {
    return (
        <select name="exampleDropdown" id="exampleDropdown">

        {props.list.map((opt) => {
            return(
                <option key={opt}>{opt}</option>
            ) 
        })}

        </select>
    );
}
 
const About = () => {
    return (
        <div>
            <h1>Login</h1>
            <h1>
                Learn
            </h1>
            <DropDown list={learnLanguages} />
            <h1>
                Using
            </h1>
            <DropDown list = {useLanguages} />
            <button>Launch Chatroom</button>
        </div>
    );
};
 
export default About;
